def approxPattern(pattern, dna, hamDist):
    subLen = len(pattern)
    indexList = []
    for i in range(len(dna) - subLen):
        subStr = dna[i:i+subLen]
        if (hammingDistance(subStr, pattern) <= hamDist):
            indexList.append(str(i))

    return ' '.join(indexList)

def hammingDistance(dna1, dna2):
    hammingDist = 0
    for i in range(len(dna1)):
        if (dna1[i] != dna2[i]):
            hammingDist += 1

    return hammingDist

